import React from "react";
import Roulette from "./roulette/roulette";
import styled from "styled-components";

const GameContainer = () => {
    let Container = styled.div `

        color: green;
        display: flex;
        justify-content: center;
        align-items: center;
        margin-top: 500px;
    `
    return (
        <div>
            <Container>

            <Roulette />
            </Container>
        </div>
    )
}

export default GameContainer;
